INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "アヤネ", 401, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", "2030/12/17 14:59:59", 0.0, 2, 24, 0.0, 2, 24001, 102301, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "アヤネ", 402, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", "2030/12/17 14:59:59", 2.21, 1, 24, 0.0, 2, 24002, 102301, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "アヤネ", 403, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", "2030/12/17 14:59:59", 0.0, 2, 24, 0.0, 2, 24003, 102301, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "アサヒ", 701, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", "2030/12/17 14:59:59", 1.99, 2, 24, 0.0, 1, 24004, 192201, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "アサヒ", 702, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", "2030/12/17 14:59:59", 2.21, 1, 24, 0.0, 2, 24005, 192201, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "アサヒ", 703, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", "2030/12/17 14:59:59", 3.33, 2, 24, 0.0, 1, 24006, 192201, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "部員３", 801, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", "2030/12/17 14:59:59", 0.0, 2, 24, 0.0, 2, 24007, 192301, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "部員３", 802, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", "2030/12/17 14:59:59", 2.68, 1, 24, 0.0, 2, 24008, 192301, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "部員３", 803, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", "2030/12/17 14:59:59", 0.0, 2, 24, 0.0, 2, 24009, 192301, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "", 501, "やった！", "2030/12/17 14:59:59", 0.0, 1, 24, 0.0, 1, 24010, 192501, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "", 502, "勝ったよ！", "2030/12/17 14:59:59", 0.0, 1, 24, 0.0, 1, 24011, 192501, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "", 503, "いい調子！", "2030/12/17 14:59:59", 0.0, 1, 24, 0.0, 1, 24012, 192501, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "ミサト", 111, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", "2030/12/17 14:59:59", 5.33, 6, 24, 0.0, 2, 24013, 113501, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "ミサト", 112, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", "2030/12/17 14:59:59", 6.85, 1, 24, 0.0, 2, 24014, 113501, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "ミサト", 113, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", "2030/12/17 14:59:59", 3.0, 1, 24, 0.0, 2, 24015, 113501, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "ダイチ", 611, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", "2030/12/17 14:59:59", 6.11, 1, 24, 0.0, 2, 24016, 192401, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "ダイチ", 612, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", "2030/12/17 14:59:59", 6.75, 1, 24, 0.0, 2, 24017, 192401, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "ダイチ", 613, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", "2030/12/17 14:59:59", 0.0, 2, 24, 0.0, 2, 24018, 192401, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "ハツネ", 211, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", "2030/12/17 14:59:59", 4.52, 2, 24, 0.0, 1, 24019, 113401, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "ハツネ", 212, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", "2030/12/17 14:59:59", 3.89, 2, 24, 0.0, 1, 24020, 113401, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "ハツネ", 213, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", "2030/12/17 14:59:59", 13.49, 1, 24, 0.0, 2, 24021, 113401, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "カヤ", 311, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", "2030/12/17 14:59:59", 3.17, 1, 24, 0.0, 2, 24022, 106501, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "カヤ", 312, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", "2030/12/17 14:59:59", 4.42, 1, 24, 0.0, 2, 24023, 106501, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "カヤ", 313, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", "2030/12/17 14:59:59", 2.89, 6, 24, 0.0, 1, 24024, 106501, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "アヤネ", 421, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", "2030/12/17 14:59:59", 3.71, 4, 24, 0.0, 3, 24025, 102301, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "アサヒ", 721, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", "2030/12/17 14:59:59", 5.1, 2, 24, 0.0, 1, 24026, 192201, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "部員３", 821, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", "2030/12/17 14:59:59", 4.34, 1, 24, 0.0, 3, 24027, 192301, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "", 521, "いい勝負だったよ\nまたやろうね", "2030/12/17 14:59:59", 0.0, 1, 24, 0.0, 1, 24028, 192501, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "ミサト", 101, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", "2030/12/17 14:59:59", 5.62, 1, 24, -360.0, 2, 24029, 113501, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "ミサト", 102, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", "2030/12/17 14:59:59", 9.58, 1, 24, -360.0, 2, 24030, 113501, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "ミサト", 103, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", "2030/12/17 14:59:59", 0.0, 2, 24, -360.0, 2, 24031, 113501, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "ミサト", 104, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", "2030/12/17 14:59:59", 9.13, 2, 24, -360.0, 1, 24032, 113501, 0.0);
INSERT INTO `v1_46b87f4d2473dceeb492d04bf317fe9a208af53de197c753de08bc78ca7edba5` VALUES ("2020/07/31 12:00:00", 10046, "ミサト", 105, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", "2030/12/17 14:59:59", 8.27, 1, 24, -360.0, 2, 24033, 113501, 0.0);
